import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Skills from './components/Skills';
import Projects from './components/Projects';
import Experience from './components/Experience';
import Education from './components/Education';
import Resume from './components/Resume';
import Contact from './components/Contact';
import Certifications from './components/Certifications'; // <-- Import here

function App() {
  return (
    <div id="scroll-container" className="h-screen overflow-y-scroll snap-y snap-mandatory scroll-smooth">
      <Navbar />
      <Hero />
      <Skills />
      <Projects />
      <Certifications />  {/* <-- Add the Certifications section */}
      <Experience />
      <Education />
      <Resume />
      <Contact />
    </div>
  );
}

export default App;
